class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        leftS, leftT = 0, 0
        lengthS, lengthT = len(s), len(t)
        while leftS < lengthS and leftT < lengthT:
            index = t.find(s[leftS], leftT)
            if index > -1:
                leftT = index + 1
                leftS += 1
            else:
                return False

        return leftS == lengthS


